import "./App.css";
import Router from "./shared/Router";
import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { __getTodos } from "./redux/modules/todos";

function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(__getTodos());
  }, [dispatch]);
  return (
    <>
      <Router />
    </>
  );
}

export default App;

